self.addEventListener("notificationclick", (event) => {
    console.log("On notification click: ", event.notification.tag);
    event.notification.close(); // Close the notification
  
    // Define the URL you want to open when the notification is clicked
    const urlToOpen = "http://127.0.0.1:5500/index.html"; // Update this to the page you want to open
  
    event.waitUntil(
      clients.matchAll({
        type: "window",
        includeUncontrolled: true // This ensures that even non-controlled windows are included
      }).then((clientList) => {
        // Focus an existing window if it matches the URL
        for (const client of clientList) {
          if (client.url === urlToOpen && "focus" in client) {
            return client.focus();
          }
        }
        // Open a new window if none match
        if (clients.openWindow) {
          return clients.openWindow(urlToOpen);
        }
      })
    );
  });
  